import './Register.css';
import { Link } from 'react-router-dom';
import logo from '../../images/logo.svg';


function Register() {
  return (
    <section className="register">
      <Link to='#' className='header__logo'>
        <img className='header__logo-img' alt='Логотип' src={logo} />
      </Link>
      
    </section>
  )
};

export default Register;
